import Axios from "axios";
import { useState, useEffect } from "react";

const axios = () => {
  const [products, setProducts] = useState([]);
  useEffect(() => {
    Axios({
      url: "http://localhost:4000/products",
    })
      .then((response) => {
        setProducts(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, [setProducts]);
  return products
};

export default axios;
